import React from 'react';
import About from './About';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Contact from './Contact';


const App = () => {
  return (
 <>         
            <Routes>
                <Route path="/about"  exact component={About} />
                <Route path="/shop" component={Contact} />  
            </Routes>    
</>

  )
}

export default App
